import axios from "axios";
import React, { useEffect, useState } from "react";
import './aboutpool.css';

function AllPool({ allPool }) {
  const loggedinUser = parseInt(localStorage.getItem("logged"));
  const [selectedRow, setSelectedRow] = useState(null);

  const [values, setValues] = useState({
    poolid: 0,
    loginid: loggedinUser,
  });

  const handleClick = (row) => {
    setSelectedRow(row);
  };
  console.log(allPool);
  useEffect(() => {
    if (selectedRow != null) {
      setValues({ poolid: selectedRow.poolId, loginid: loggedinUser });
      console.log(values);
    }
  }, [selectedRow]);

  const handleCheckIn = () => {
    axios
      .post("http://localhost:8081/checkin", values)
      .then((res) => {
        console.log(res);
      })
      .catch((error) => {
        console.log(error.response.data);
        // toast.error(error.response.data.error, {
        //   position: "top-center",
        // });
      });
  };

  return (
    <>
    <div>
      {/* <div>These are available pools</div><br /><br /><br /><br /><br /> */}
      <div className="mainpool">
        {allPool.map((item) => (










       


          <section className="wrapper">
  <div class="container" key={item.id} onClick={() => handleClick(item)}>
    <div class="row">
      <div class="col-sm-12 col-md-6 col-lg-4 mb-4">
        <div
          class="card text-white card-has-bg click-col"
          style="
            background-image: url('https://source.unsplash.com/600x900/?tech,street');
          "
        >
          <img
            class="card-img d-none"
            src="https://source.unsplash.com/600x900/?tech,street"
            alt="Goverment Lorem Ipsum Sit Amet Consectetur dipisi?"
          />
          <div class="card-img-overlay d-flex flex-column">
            <div class="card-body">
              <small class="card-meta mb-2">Thought Leadership</small>
              <h4 class="card-title mt-0">
                <a class="text-white" herf="#"
                  >{item.poolBy}</a
                >
              </h4>
              <small><i class="far fa-clock"></i> {item.poolDate}</small>
            </div>
            <div class="card-footer">
              <div class="media">
                <img
                  class="mr-3 rounded-circle"
                  src="https://assets.codepen.io/460692/internal/avatars/users/default.png"
                  alt="Generic placeholder image"
                  style="max-width: 50px"
                />
                <div class="media-body">
                  <h6 class="my-0 text-white d-block">{item.poolFrom}</h6>
                  <small>{item.poolTo}</small>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
</section>














        ))}
      </div>
      <div clas>
      {selectedRow && (
        <div>
          <p>{selectedRow.poolTo}</p>
          <p>{selectedRow.poolDate}</p>
          <p>{selectedRow.poolBy}</p>
          <p>{loggedinUser}</p>
          <p>
            {selectedRow.members.map((e) => {
              return <div>{e}</div>;
            })}
          </p>
          {selectedRow.members.includes(loggedinUser) === true ? (
            <button disabled>You have already checked in </button>
          ) : selectedRow.availableSeats > 0 ? (
            <button onClick={handleCheckIn}>Check In</button>
          ) : (
            <button disabled>Full </button>
          )}
        </div>
      )}
      </div>
      </div>
    </>
  );
}

export default AllPool;
